import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './Components/NavBar.js';

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <NavBar></NavBar>
      </React.Fragment>
    );
  }
}

export default App;
